        public string getStringFromDate(string dateStr)
        {
            DateTime date1970 = new DateTime(1969, 12, 31, 23, 59, 59);
            string retDate = "";
            if (dateStr != null)
            {
                DateTime date = DateTime.Parse(dateStr);
                if (date.Year > date1970.Year)
                    retDate = date.ToString("d");
            }
            return retDate;
        }

